So, you can do it a number of ways. Perhaps the easiest is to find the registration functions list_diff.cc and insert a print
```cpp
#include <iostream>
static int forced_build = []() {
  std::cout<<("I have this module\n")<<std::endl;
  return 5;
}
```
Make sure you see the printf when you load the tensorflow library you built.
